import React from 'react';
import { Link } from "react-router-dom";
/** @jsxImportSource @emotion/react */
import { css, ThemeProvider } from '@emotion/react';


const HomePage = () => {
     return (
       <div
         className="home"
         css={css`
           display: flex;
           flex-direction: column;
           align-items: center;
           justify-content: center;
           height: 100vh;
           background-color: cadetblue;
         `}
       >
         <h1
           css={css`
             font-size: 3rem;
             color: white;
           `}
         >
           Bockscar Device Tracker Home Page
         </h1>
         <Link
           to="/dashboard"
           css={css`
             margin-top: 2rem;
             font-size: 1.5rem;
             color: white;
             text-decoration: none;
             border-bottom: 2px solid white;
           `}
         >
           Dashboard
         </Link>
         <Link
           to="/devices"
           css={css`
             margin-top: 2rem;
             font-size: 1.5rem;
             color: white;
             text-decoration: none;
             border-bottom: 2px solid white;
           `}
         >
           View Device List
         </Link>
       </div>
     );
   };
export default HomePage;
